import React from 'react';

import '../styles/nav.css';

function Nav() {

    const submit = (e) =>{
        e.preventDefault;
        alert('ok');
    }

    return (
        <nav>
            <div className="logo">
                Your Tasks
            </div>
            <div className="form">
                <form action="">
                    <input type="text" placeholder="Write your Task"/>
                    <button type="submit" onClick={e=>submit(e)}>Create it!</button>
                </form>
            </div>
        </nav>
    );
}

export default Nav;
